        public func get(_ row: Int, _ col: Int) -> Int {
            return matrix[row][col]
        }
        public func dimensions() -> [Int] {
            let rows = matrix.count
            let columns = matrix[0].count
            return [
                rows,
                columns,
            ]
        }
    };
    
    class Solution {
        func leftMostColumnWithOne(_ binaryMatrix: BinaryMatrix) -> Int {
            let dimensions = binaryMatrix.dimensions()
            let rows = dimensions[0]
            let columns = dimensions[1]
            var columnIndex = columns - 1
            var leftMostColumn = 100
            
            for row in 0 ..< rows {
                while columnIndex >= 0 {
                    let num = binaryMatrix.get(row, columnIndex)
                    if num == 0 {
                        break
                    } else if num == 1 {
                        leftMostColumn = min(leftMostColumn, columnIndex)
                        columnIndex -= 1
                    }
                }
            }
            
            return leftMostColumn == 100 ? -1 : leftMostColumn
        }
    }
}
